const nodemailer = require('nodemailer');
const inlineBase64 = require('nodemailer-plugin-inline-base64');
const redis = require('redis');
const client = redis.createClient(process.env.REDIS_URL);

exports.sendEmail = (req, res) => {
    var transporter = nodemailer.createTransport({
        service: 'zoho',
        auth: {
            user: 'admin@nutriem.com.ar',
            pass: '@Nutriem2018'
        }
    });

    transporter.use('compile', inlineBase64());

    var mailOptions = {
        from: 'admin@nutriem.com.ar',
        to: 'consultas@nutriem.com.ar',
        subject: 'Nuevo Mensaje (1)',
        text: '',
        html: `<html>
    <head>
    </head>
    <body>
        <div style="margin:0 auto;max-width:600px; background: #e3e3e3; padding: 2rem 1rem; border-radius: 5px; text-align:center; box-shadow: 1px 1px 1px 1px #0a0a0a;">
            <img src="data:image/png;base64," style="text-align: center; max-width: 200px;" alt="">
            <h2 style="color: #ff9933; text-align: center;">
                Nueva consulta de ${req.body.empresa}
            </h2>
            <p stlye=text-align: left;>
                ${req.body.mensaje}
            </p>
    
            <span style="font-weight: bold;">Datos de contacto: </span>
            <ul style="list-style: none;">
                <li>Email: ${req.body.email}</li>
                <li>Telfono: +54${req.body.telefono}</li>
                <li>Direccin: ${req.body.direccion}, ${req.body.barrio}</li>
            </ul>
        </div>
    </body>
    </html>`
    };

    transporter.sendMail(mailOptions, function(error, info){
        if(error){
            console.log(error);
            res.status(500).json({message: error});
        }else{
            console.log(info.response);
            res.status(200).json({message: info.response});
        }
    });
};

exports.getNews = function (req, res) {
    client.get('news', function (error, result) {
        if (error) {
            res.json(error);
        }
        res.json(result);
    });
};
